const userSubmitEl=$("#user-submit"),userListEl=$(".userInfo");userSubmitEl.on("click",a=>{function b(a){return a.toLowerCase().split(" ").map(a=>a.charAt(0).toUpperCase()+a.substring(1)).join(" ")}a.preventDefault();const c={firstName:b($("#first_name").val().trim()),lastName:b($("#last_name").val().trim())};return 0===c.firstName.length?void swal({icon:"error",title:"Please Enter First Name"}):0===c.lastName.length?void swal({icon:"error",title:"Please Enter Last Name"}):void $.post("/api/newUser",c).then(a=>{$.get("/api/user/"+a.id).then(a=>{window.location.replace("/shift?userId="+a.id)})})}),userListEl.on("click",function(a){a.preventDefault();const b=$(this).data("id");window.location.replace("/shift?userId="+b)});